Defendant in custody.
The State moves to dismiss the repeater enhancer.  Motion granted.
NO CONTEST plea entered to the charge of deliver cocaine.  Convicted.
The defendant is sentenced to the Wisconsin State Prison System for a total of thirty-one (31) months.  That is thirteen (13) months initial confinement followed by eighteen (18) months extended supervision, consecutive to the sentence presently serving on 13 CF 142.
The Court finds the defendant eligible for both the Challenge Incarceration Program and the Substance Abuse Program.
Conditions of extended supervision:
1) Pay court costs including the $200.00 buy money to Metro Drug;
2) pay supervision fees in an amount to be determined by DOC;
3) maintain absolute sobriety;
4) no association with any known drug dealers or users;
5) assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
6) provide a DNA sample and pay the surcharge.
The defendant has credit for 1 day.
MInutes.
